import React, { useState, useEffect } from 'react';

function WeatherForecast({ destination }) {
  const [forecast, setForecast] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  // This is a mock forecast since we don't have a real API key
  // In a real application, you would fetch from a weather API
  useEffect(() => {
    if (!destination) return;

    setLoading(true);

    // Simulate API call
    setTimeout(() => {
      // Generate mock weather data
      const today = new Date();
      const mockForecast = {
        location: destination,
        current: {
          temp: Math.floor(Math.random() * 15) + 15, // 15-30¬∞C
          condition: ['Sunny', 'Partly Cloudy', 'Cloudy', 'Light Rain', 'Thunderstorm'][Math.floor(Math.random() * 5)],
          humidity: Math.floor(Math.random() * 30) + 50, // 50-80%
          windSpeed: Math.floor(Math.random() * 20) + 5, // 5-25 km/h
        },
        daily: Array.from({ length: 5 }, (_, i) => {
          const day = new Date(today);
          day.setDate(today.getDate() + i + 1);

          return {
            date: day.toISOString().split('T')[0],
            dayName: ['Sunday', 'Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday', 'Saturday'][day.getDay()],
            high: Math.floor(Math.random() * 10) + 20, // 20-30¬∞C
            low: Math.floor(Math.random() * 10) + 10, // 10-20¬∞C
            condition: ['Sunny', 'Partly Cloudy', 'Cloudy', 'Light Rain', 'Thunderstorm'][Math.floor(Math.random() * 5)],
          };
        })
      };

      setForecast(mockForecast);
      setLoading(false);
    }, 1000);

  }, [destination]);

  // Weather icon mapping
  const getWeatherIcon = (condition) => {
    switch (condition.toLowerCase()) {
      case 'sunny':
        return '‚òÄÔ∏è';
      case 'partly cloudy':
        return '‚õÖ';
      case 'cloudy':
        return '‚òÅÔ∏è';
      case 'light rain':
        return 'üåßÔ∏è';
      case 'thunderstorm':
        return '‚õàÔ∏è';
      default:
        return 'üå§Ô∏è';
    }
  };

  if (loading) {
    return (
      <div className="bg-blue-50 p-4 rounded-lg text-center">
        <p className="text-gray-600">Loading weather forecast...</p>
      </div>
    );
  }

  if (error) {
    return (
      <div className="bg-red-50 p-4 rounded-lg">
        <p className="text-red-600">Error loading weather: {error}</p>
      </div>
    );
  }

  if (!forecast) {
    return (
      <div className="bg-blue-50 p-4 rounded-lg text-center">
        <p className="text-gray-600">Select a destination to see the weather forecast.</p>
      </div>
    );
  }

  return (
    <div className="bg-blue-50 p-4 rounded-lg">
      <h3 className="font-semibold mb-3">Weather Forecast for {forecast.location}</h3>

      {/* Current Weather */}
      <div className="bg-white p-4 rounded-lg shadow-sm mb-4">
        <div className="flex items-center justify-between">
          <div>
            <h4 className="font-medium">Current Weather</h4>
            <p className="text-3xl font-bold mt-1">{forecast.current.temp}¬∞C</p>
            <p className="text-gray-600">{forecast.current.condition}</p>
          </div>
          <div className="text-5xl">
            {getWeatherIcon(forecast.current.condition)}
          </div>
        </div>
        <div className="mt-3 flex justify-between text-sm text-gray-600">
          <p>Humidity: {forecast.current.humidity}%</p>
          <p>Wind: {forecast.current.windSpeed} km/h</p>
        </div>
      </div>

      {/* 5-Day Forecast */}
      <h4 className="font-medium mb-2">5-Day Forecast</h4>
      <div className="grid grid-cols-5 gap-2">
        {forecast.daily.map(day => (
          <div key={day.date} className="bg-white p-2 rounded-lg shadow-sm text-center">
            <p className="text-xs text-gray-600">{day.dayName.substring(0, 3)}</p>
            <div className="text-xl my-1">{getWeatherIcon(day.condition)}</div>
            <p className="text-sm font-medium">{day.high}¬∞ <span className="text-gray-500">{day.low}¬∞</span></p>
          </div>
        ))}
      </div>

      <div className="mt-3 text-xs text-gray-500 text-center">
        <p>* This is simulated weather data for demonstration purposes.</p>
        <p>In a production app, this would use real-time data from a weather API.</p>
      </div>
    </div>
  );
}

export default WeatherForecast;
